import React from 'react';

const RoomBox = ({ roomNumber, capacity, slotsLeft }) => {
  return (
    <div className="w-36 h-36  bg-lime-700 m-5">
      <p> {roomNumber}</p>
      <p>{capacity}</p>
      <p> {slotsLeft}</p>
    </div>
  );
};

export default RoomBox;
